.es| influenced by = }}ECMAScript అనేది ఒక ప్రోగ్రామింగ్ భాష. 1997;25 సంవత్సరాల క్రితం (1997)లో మొదటిగా ఈ ప్రోగ్రామింగ్ భాష విడుదల అయ్యింది. బ్రెండన్ యువర్, ECMA ఇంటర్నేషనల్ ఈ భాషని అభివృద్ధి చేసారు. ఇది బలహీనమైన, డైనమిక్ టైపింగ్ భాష. .mw-parser-output .monospaced{font-family:monospace,monospace}
.es ఈ భాష యొక్క ఫైల్ అంత్యాక్షరాలు. ఈ భాష జావా, సి, పైథాన్, పెర్ల్, హైపర్‌టాక్, స్కీమ్, ఇబ్బంది, కాఫీస్క్రిప్ట్, సెల్ఫ్ ద్వారా ప్రభావితమైంది.
